import React, { Component } from 'react'; import BookListItem from '../book-list-item';
import './book-list.css';

class BookList extends Component {
  render() {
    const { books } = this.props;
    return (
      <ul>
        {
          books.map((book) => {
            return <li>
              <BookListItemm book={book} />
            </li>
          })
        }
      </ul>
    );
  }
}

export default BookList;
